const frogsData  = require('../data/frogs.json');
let frogs = [];


console.log(frogs);
function here(){
    for(let f in frogsData){
        let img = require(frogsData[f]['image'])
        let frogCleanse = {
            'id': frogsData[f]['id'],
            'name': frogsData[f]['name'],
            "image": img
        }
        frogs.push(frogCleanse);
    }
    return frogs;
}
export default {}
